import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);
const state = {
    count:1
}

const mutations ={};
const actions ={};
const getters ={};

export default new Vuex.Store({
    state,
    mutations,
    actions,
    getters
});
